import React from "react";
import "./recent.css";
const Recent = props => {
  const presentation = props.presentation;

  const lastPresentation = () => {
    const data = presentation.filter(
      item => item.id === presentation.length - 1
    );
    console.log(data);

    return data.map(item => <div>{item.id}</div>);
  };
  return <div className="recent">{this.lastPresentation()}</div>;
};

export default Recent;
